import React, { useState, useEffect } from 'react';
import './content.css';

// React-tabs Module
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';


//import { BarChart, CartesianGrid, XAxis, YAxis, Tooltip, Bar, Cell } from 'recharts';

function Databox() {

  let [Email, setEmail] = useState('eerokos');
  const [dataset, setDataset] = useState([]);
  let tabledata = [];


  useEffect(() => {
    getData();
  }, []);

  async function getData() {
    fetch('http://localhost:3000/' + Email)
      .then(res => {
        if (res.status === 200) {
          return res.json();
        } else {
          const error = new Error(res.error);
          throw error;
        }
      })
      .then(data => { setDataset(data);  })      
      .catch(error => console.error('Error:', error))
  }


  return (
    <Tabs className="box">
      <TabList>
        <Tab>Array</Tab>
        <Tab>Graph</Tab>
      </TabList>

      <TabPanel>
        <table>
          <tbody>
            <thead>
            {dataset.map((c, index) =>
              <tr key={index.id}>
                <td>{c.tosleep}</td>
                <td>{c.formsleep}</td>
                <td>{c.totalHours}</td>
                <td>{c.range}</td>
              </tr>
            )}
            </thead>
            {dataset.map((c, index) =>
              <tr key={c.id}>
                <td>{c.tosleep}</td>
                <td>{c.formsleep}</td>
                <td>{c.totalHours}</td>
                <td>{c.range}</td>
              </tr>
            )}
          </tbody>
        </table>
      </TabPanel>
      <TabPanel>

      </TabPanel>
    </Tabs>
  );
}

export default Databox;
